import Home from "./components/home/home";
import Login from "./components/"
const App = () => {
  return (
    <div>
      <Switch>
        <Route
          exact
          path="/"
          render={() => {
            return <Home></Home>;
          }}
        />
      </Switch>
    </div>
  );
};

export default App;
